import styled from "styled-components"

export const CenteredContainer = styled.div`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
`

export const CenteredContent = styled.div`
  min-height: 20%;
  display: flex;
  flex-direction: column;
  align-items: center;
`
